create table orders
(
    id                     int unsigned auto_increment comment '订单ID'
        primary key,
    serial_number          varchar(32)                            not null comment '订单编号',
    payment_id             int unsigned                           not null comment '账单ID',
    out_trade_no           varchar(32)                            not null comment '账单编号',
    user_id                int unsigned                           not null comment '买家用户ID',
    user_union_id          char(255)                              not null comment '买家用户UnionId',
    store_id               int unsigned default 0                 not null comment '店铺ID',
    store_name             varchar(64)                            not null comment '店铺名称',
    logo_file_id           int unsigned                           not null comment '店铺LOGO文件ID',
    logo_file_path         varchar(255)                           not null comment '店铺LOGO文件相对路径',
    logo_file_url          text                                   not null comment '店铺LOGO文件URL',
    product_price_in_cents bigint unsigned                        not null comment '订单商品总价',
    used_redemption_point  int unsigned default 0                 not null comment '已使用的复购积分总数',
    final_price_in_cents   bigint unsigned                        not null comment '订单总价（需支付的金额）',
    status                 tinyint                                not null comment '订单状态，0：待支付、1：已支付（待发货）、2：已发货、3：已签收（已完成）、4：已取消',
    delivery_contact_name  varchar(64)                            not null comment '联系人姓名',
    delivery_contact_phone varchar(32)                            not null comment '联系人电话',
    delivery_province      varchar(16)                            not null comment '省份',
    delivery_city          varchar(16)                            not null comment '市级行政区',
    delivery_district      varchar(16)                            not null comment '县级行政区',
    delivery_town          varchar(16)                            not null comment '乡镇街道',
    delivery_address       text                                   not null comment '详细地址（用户填写内容，理论上应不含省市区街道）',
    order_comment          text                                   null comment '订单备注',
    paid_at                datetime                               null comment '支付时间',
    signed_at              datetime                               null comment '签收时间',
    created_at             datetime     default CURRENT_TIMESTAMP not null,
    updated_at             datetime                               null,
    deleted_at             datetime                               null
)
    collate = utf8mb4_unicode_ci;

create index orders_out_trade_no_index
    on orders (out_trade_no);

create index orders_paid_at_index
    on orders (paid_at);

create index orders_payment_id_index
    on orders (payment_id);

create index orders_serial_number_index
    on orders (serial_number);

create index orders_signed_at_index
    on orders (signed_at);

create index orders_store_id_index
    on orders (store_id);

create index orders_user_id_index
    on orders (user_id);

create index orders_user_union_id_index
    on orders (user_union_id);

